class Ieee8021XMkaKeyServerPriority(TextualConvention, OctetString):
    reference = 'IEEE 802.1X Clause 9.5, Table 9-2'
    description = "This textual convention indicates a Key Server priority information. Each MKA participant encodes a Key Server Priority, an 8-bit integer, in each MKPDU. Each participant selects the live participant advertising the highest priority as its Key Server provided that participant has not selected another as its Key Server or is unwilling to act as the Key Server. If a Key Server cannot be selected SAKs are not distributed. In the event of a tie for highest priority Key Server, the member with the highest priority SCI is chosen. For consistency with other uses of the SCI's MAC Address component as a priority, numerically lower values of the Key Server Priority and SCI are accorded the highest priority. The Table 9-2 contains recommendations for the use of priority values for various system roles. Participants that will never act as a Key Server should advertise priority 0xFF."
    status = 'current'
    subtypeSpec = OctetString.subtypeSpec + ValueSizeConstraint(1, 1)
    fixedLength = 1

class Ieee8021XMkaMI(TextualConvention, OctetString):
    reference = 'IEEE 802.1X Clause 9.4.2'
    description = 'This textual convention indicates a Member Identifier (MI). The MI is a 96-bit random value chosen when the MKA Instance begins, used with a 32-bit MN to protect against replay attacks and to record liveliness in the Live Peer List or potential liveliness in the Potential Peer List. If the MN wraps, a new random MI value is chosen and the MN begins again at 1.'
    status = 'current'
    subtypeSpec = OctetString.subtypeSpec + ValueSizeConstraint(12, 12)
    fixedLength = 12

class Ieee8021XMkaMN(TextualConvention, Unsigned32):
    reference = 'IEEE 802.1X Clause 9.4.2'
    description = 'This textual convention indicates a Member Number (MN). The MN is a 32-bit value which begins at 1 and increases for each MKPDU transmitted. It is used with the MI to protect against replay attacks and to record liveliness in the Live Peers List or potential liveliness in the Potential Peer List. If the MN wraps, a new random MI value is chosen and the MN begins again at a value of 1.'
    status = 'current'
    displayHint = 'd'
    subtypeSpec = Unsigned32.subtypeSpec + ValueRangeConstraint(1, 2147483648)

class Ieee8021XMkaKN(TextualConvention, Unsigned32):
    reference = 'IEEE 802.1X Clause 9.8'
    description = 'This textual convention indicates a Key Number (KN) used in MKA. The MN is a 32-bit integer assigned by that Key Server (sequentially, beginning with 1).'
    status = 'current'
    displayHint = 'd'
    subtypeSpec = Unsigned32.subtypeSpec + ValueRangeConstraint(1, 2147483648)

class Ieee8021XPaeNIDCapabilites(TextualConvention, Bits):
    reference = 'IEEE 802.1X Clause 10.1, Table 11-8'
    description = 'This textual convention indicates the combinations of authentication and protection capabilities supported for a NID. Any set of these combinations can be supported.'
